   "source": [
    "library(ggplot2)\n",
    "\n",
    "# Dados\n",
    "faixas_idade <- c(\"0-20\", \"21-30\", \"31-40\", \"41-50\", \"51-60\", \"61+\")\n",
    "porcentagem_renda <- c(0.490, 10.6, 27.3, 29.3, 22.6, 9.69)\n",
    "media_renda <- mean(porcentagem_renda)  # Calculando a média da renda\n",
    "\n",
    "# Criando o data frame\n",
    "dados <- data.frame(faixas_idade, porcentagem_renda)\n",
    "\n",
    "# Criando o gráfico\n",
    "ggplot(dados, aes(x = faixas_idade, y = porcentagem_renda)) + \n",
    "  geom_bar(stat = \"identity\", fill = \"lightblue\", color = \"black\") +\n",
    "  labs(x = \"Faixa Etária\", y = \"Porcentagem de Renda\",\n",
    "       title = \"Porcentagem de Renda por Faixa Etária\") +\n",
    "  ylim(0, max(porcentagem_renda) * 1.1) +  # Ajustando o limite do eixo y\n",
    "  theme_minimal()  # Estilo do gráfico\n",
    "\n"
   ]
