    "A faixa-etária de 41 aos 50 anos possui a maior porcentagem da renda,com 29.3% do total\n",
    "\n",
    "As faixas etárias de 31 a 40 anos (27.3%)51 a 60 anos (22.6%) também têm uma proporção significativa de renda, causando um agrupamento no centro do gráfico.\n",
