    "Isso pode refletir o estágio da vida em que as pessoas estão mais estabelecidas em suas carreiras e têm um maior potencial de ganhos durante as décadas de 30 a 50 anos, enquanto a renda pode diminuir após a aposentadoria, representada pela faixa etária de 61+ anos.\n",
