    "A mediana e o terceiro quartil são maiores em comparação com os homens amarelos, indicando uma tendência de renda mais alta para as mulheres deste grupo.\n",
    "A amplitude interquartil é mais ampla para as mulheres amarelas, especialmente quando rendas acima de 5 mil são excluídas, sugerindo uma maior variação na renda dentro deste grupo.\n",
    "Indígenas:\n",
    "\n",
    "Tanto homens quanto mulheres indígenas têm as menores medianas de renda em comparação com outros grupos.\n",
    "Novamente, as mulheres indígenas lideram em termos de renda dentro deste grupo, indicando uma possível disparidade de gênero na distribuição da renda.\n",
    "Pessoas Pretas e Pardas:\n",
    "\n",
    "Tanto homens quanto mulheres pretos e pardos apresentam medianas de renda inferiores ao restante dos grupos étnicos.\n",
    "Isso sugere uma possível disparidade racial na distribuição da renda, com pessoas pretas e pardas geralmente apresentando rendas mais baixas."
