   "source": [
    "Em geral, há uma tendência positiva entre os anos de estudo e a renda, o que é evidenciado pelo aumento da mediana da renda à medida que os anos de estudo aumentam.\n",
    "Pessoas com maior número de anos de estudo tendem a ter rendas mais altas, enquanto aqueles com menor número de anos de estudo tendem a ter rendas mais baixas. Isso sugere a importância da educação na determinação da renda.\n",
    "Disparidades de Gênero:\n",
    "\n",
    "Em muitos níveis de anos de estudo, as medianas de renda para homens são mais altas do que para mulheres, indicando uma disparidade de gênero na distribuição da renda.\n",
    "Essa disparidade de gênero é mais evidente em certos níveis de anos de estudo, onde as caixas para homens são mais altas do que para mulheres, especialmente em níveis mais elevados de educação.\n",
    "Variação da Renda:\n",
    "\n",
    "A amplitude interquartil (IQR) varia significativamente entre os diferentes níveis de anos de estudo. Em geral, quanto maior o número de anos de estudo, maior a variabilidade da renda dentro desse grupo.\n",
    "No entanto, em alguns níveis de anos de estudo, a IQR pode ser relativamente estreita, indicando uma menor variabilidade na renda dentro desse grupo.\n",
    "Impacto da Educação na Renda:\n",
    "\n",
    "A partir da análise das medianas, é evidente que a educação desempenha um papel crucial na determinação da renda. Pessoas com maior nível de educação tendem a ter rendas mais altas, o que destaca a importância do investimento em educação para melhorar o status socioeconômico."
   ]
