    "A análise deste conjunto de dados foi valiosa para adquirir conhecimentos fundamentais de Estatística e R. Pretendo revisitar esse conjunto de dados à medida que minhas habilidades na linguagem se aprimorem, aprimorando tanto as ferramentas quanto a própria análise. Um aspecto que me chamou mais atenção foi a desigualdade numérica entre pessoas brancas e pardas, negras ou indígenas. Essa disparidade também foi evidenciada na discrepância de renda entre homens e mulheres, destacando-se em todos os gráficos analisados de forma bastante evidente"
